import majorApi from "../api/majorApi";

const getListMajor = async () => {
    try {
        const res = await majorApi.getAll();
        console.log(res);
    } catch (error) {
        console.log("Failed");
    }
}
const majorInitialState = {
    listMajor: majorApi.getAll()
}
const categoriesReducer = (state = majorInitialState, action) => {
    switch (action.type) {
         
        default:
            return state;
    }
}

export default categoriesReducer;
